    string FormatGrades(long nota)
    {
        string calificacion = nota >= 90 && nota <= 100 ? "A" :
                              nota >= 80 && nota <= 89 ? "B" :
                              nota >= 70 && nota <= 79 ? "C" : "F";
        return calificacion;
    }

